    borderBottomColor: "#ccc",
    borderBottomWidth: 1,
    width: 300,
  },
  buttonSubmit: {
    marginTop: 15,
    width: 350,
    height: 50,
    backgroundColor: "#F5C300",
    marginBottom: 10,
    alignItems: "center",
    justifyContent: "center",
    borderRadius: 3,
  },
  textSubmit: {
    fontSize: 20,
    color: "white",
    fontWeight: "bold",
  },

  buttonPagar: {
    width: 200,
    height: 50,
    backgroundColor: "#F5C300",
    alignItems: "center",
    justifyContent: "center",
    marginTop: 10,
    marginBottom: 10,
    borderRadius: 8,
    borderWidth: 1,
  },
  textPagar: {
    fontSize: 20,
    color: "#03255F",
    fontWeight: "bold",
  },

  //Home
  bodyHome: {
    flex: 6,
    alignItems: "center",
  },
  buttonsHome: {
    flex: 2,
    flexDirection: "row",
