    height: 110,
    backgroundColor: "#03255F",
    alignItems: "center",
    justifyContent: "center",
    marginRight: 3,
    marginLeft: 5,
  },
  buttonYellow: {
    width: 110,
    height: 110,
    backgroundColor: "#F5C300",
    alignItems: "center",
    justifyContent: "center",
    marginRight: 5,
    marginLeft: 5,
  },
  textUsers: {
    fontSize: 17,
    color: "#F5C300",
    fontWeight: "bold",
    justifyContent: "center",
    textAlign: "center",
  },
  textCompany: {
    fontSize: 17,
    color: "#03255F",
    fontWeight: "bold",
    justifyContent: "center",
    textAlign: "center",
  },
